Thought: Let's search for any powershell-related events on device "vnevado-win10e" in DeviceProcessEvents so we can see if any account SID information is available in those events. I'll query for events with ProcessCommandLine like '%powershell%' on "vnevado-win10e", and then inspect the resulting fields (AccountSid, InitiatingProcessAccountSid, etc.) to see if one of them contains the SID we need.
Action: execute[SELECT DISTINCT AccountSid, AccountUpn, InitiatingProcessAccountSid, InitiatingProcessAccountUpn, ProcessCommandLine, TimeGenerated 
FROM DeviceProcessEvents 
WHERE DeviceName = 'vnevado-win10e' 
  AND ProcessCommandLine LIKE '%powershell%';
]
